import { Box, TextField } from '@mui/material'
import React from 'react'
import SearchIcon from '@mui/icons-material/Search';
import './menu.css'

function menu() {
    return (
        <Box sx={{
            width:'35rem',
            height:'3rem',
            display:'flex',
            justifyContent:'center',
            alignItems:'center'
        }}>
            <TextField size="small" fullWidth label="" id="fullWidth" />
            <Box sx={{
                bgcolor:'grey',
                width:'2rem',
                height:'2.5rem',
                borderRadius:'0rem 0rem 0rem 1rem'
            }}>
                <SearchIcon/>
            </Box>
        </Box>
    )
}

export default menu
